        DreamSymbols(symbolName: "ZİNDAN", symbolMean: "Kişinin olumsuz düşünce kalıplarından çıkamamasını ve zihinsel kalıplarını kıramamasını simgeler. Kişinin bu konularda çok zorlandığını ifade eder.", symbolID: 1485),
        DreamSymbols(symbolName: "ZİRAAT", symbolMean: "Kişinin kendisinde olan verimliliği ortaya açıkarmasını simgeler. ", symbolID: 1486),
        DreamSymbols(symbolName: "ZİYAFET GÖRMEK", symbolMean: "Ziyafet sofrası görmek, kişinin yaptıklarının karşılığını iyi ya da kötü olarak alacağı döneme geldiğini simgeler. Sofranın içinde olanlar dikkate alınarak rüyanın yorumlanması gerekir.", symbolID: 1487),
        DreamSymbols(symbolName: "ZİYARET", symbolMean: "Ziyaret edilen kişinin ya da yerin özelliğine göre kişinin o yöne eğilmesi ve düşünmesi gerektiğini simgeler. Ayrıca ziyaretin gerçek manada da yapılması gerekir.", symbolID: 1488),
        DreamSymbols(symbolName: "ZİYNET", symbolMean: "Kıymet vermeyi simgeler. Kişi kendi ziynet eşyasını (altın ve gümüş olan takıları) bir arada nerede görüyorsa, oradan kıymet gördüğünü anlayabilir. ", symbolID: 1489),
        DreamSymbols(symbolName: "ZONBİ", symbolMean: "Şuursuzluğu ve aşırı derecede bilinçsiz olma durumunu simgeler.", symbolID: 1490),
        DreamSymbols(symbolName: "ZULÜM GÖRMEK", symbolMean: "Kişinin feraha ereceğini simgeler.", symbolID: 1491),
        // Diğer semboller buraya eklenebilir...
    ]
    
    var filteredSymbols: [DreamSymbols] {
        if searchText.isEmpty {
            return symbols
        } else {
            return symbols.filter { $0.symbolName.localizedCaseInsensitiveContains(searchText) }
        }
    }

    var body: some View {
        VStack {
            // Search Bar
            HStack {
                TextField("Ara...", text: $searchText)
                    .padding(10)
                    .background(Color.gray.opacity(0.2))
                    .cornerRadius(8)
                    .padding(.horizontal)
            }
            .padding(.top)

            // CollectionView
            ScrollView {
                LazyVGrid(columns: [GridItem(.flexible()), GridItem(.flexible())], spacing: 20) {
                    ForEach(filteredSymbols) { symbol in
                        NavigationLink(destination: SymbolDetailView(symbol: symbol)) {
                            VStack {
                                Text(symbol.symbolName)
                                    .font(.headline)
                                    .foregroundColor(.white)
                                    .padding()
                                    .frame(maxWidth: .infinity, maxHeight: .infinity)
                                    .background(
                                        LinearGradient(gradient: Gradient(colors: [Color.blue, Color.purple]),
                                                       startPoint: .topLeading,
                                                       endPoint: .bottomTrailing)
                                    )
                                    .cornerRadius(15)
                                    .shadow(color: Color.black.opacity(0.2), radius: 10, x: 0, y: 5)
                            }
                            .frame(height: 150)
                        }
                    }
                }
                .padding()
            }
        }
        .navigationTitle("Semboller")
    }
}

// Detay Sayfası
struct SymbolDetailView: View {
    let symbol: DreamSymbols
    
    var body: some View {
        VStack(spacing: 20) {
            Text(symbol.symbolName)
                .font(.largeTitle)
                .fontWeight(.bold)
                .padding()
            
            Text(symbol.symbolMean)
                .font(.body)
                .padding()
            
            Spacer()
        }
        .navigationTitle("Sembol Anlamı")
        .padding()
    }
}



